import styled from "styled-components";

export const PageNavigationStyle = styled.div`
  position: absolute;
  top: 0;
  left: 0;

  .dots_box {
    width: 100%;
    height: 100%;
    background-color: #f0f0f0;
  }

  .dots {
    width: 10px;
    height: 10px;
    background-color: #f0f0f0;
  }
`;
